	add("samadhi", "{\"term\":\"samadhi\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Sanskrit\"], \"text\":\"From Sanskrit \u0027sc\u003ddeva|tr\u003dsamādhi|समाधि\u0027 (placing together) from \u0027सम|tr\u003dsam|sc\u003ddeva\u0027 (together) + \u0027आ\u0027 prefix + \u0027sc\u003ddeva\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A state of transcendent union supposed to be assumed by a holy man or yogi at his death\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Salman Rushdie, \u0027Shalimar the Clown\u0027, Vintage 2006, p. 227\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"She had seated herself cross-legged in the \u0027\u0027\u0027samadhi\u0027\u0027\u0027 position and simply ceased to be\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The highest state of meditation, at which complete unity is reached\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1902\u0027\u0027, William James, \u0027The Varities of Religious Experience\u0027, Folio Society 2008, p. 340\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The yogi, or disciple, who has by these means overcome the obscurations of his lower nature sufficiently, enters into the condition termed \u0027\u0027\u0027samâdhi\u0027\u0027\u0027, and ‘comes face to face with facts which no instinct or reason can ever know\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The tomb of a holy person or saint in India\", \"priority\":7}]}, \"synonyms\":{}}");

