	add("samantha", "{\"term\":\"samantha\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"The etymology is uncertain. It has been recorded in the 17th century in England https://familysearch.org/search/record/results?count\u003d20\u0026amp;query\u003d%2Bgivenname%3Asamantha\u0026amp;birth_year0\u003d1600 Most probably a feminine form of Samuel, possibly influenced byAnthea. Other suggestions include the Aramaic noun \u0027ܫܡܥܢܬܐ|lang\u003darc|tr\u003dšemʿanta\u0027 () from ܫܡܥ. In India, Samantha can be interpreted as a variant spelling of \u0027\u0027 from the Sanskrit word meaning \u0026quot;universal, adjacent\u0026quot;.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"1876\u0027\u0027 Phebe Ann Hanaford, \u0027Women of the Century\u0027, page 525\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"These country girls, as they were called, had queer names, which added to the singularity of their appearance. \u0027\u0027Samantha\u0027\u0027, Triphena, Plumy, Leafy, Ruhamah, Lovey, and Florilla were among them\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1888\u0027\u0027, \u0027Josiah Allen\u0027s Wife as a P.A. and P.I.: Samantha at the Centennial\u0027, page 577\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"quot;Its name is \u0027\u0027Samantha\u0027\u0027 Jo, after Josiah and me. - - - If it had been a boy, we was layin\u0027 out to call it Josiah Sam, - Sam for \u0027\u0027Samantha\u0027\u0027.\u0026quot\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1967\u0027\u0027 , \u0027Samantha\u0027, I Books (2004), ISBN 0743479122, page 42\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"quot;Middle of the depression - who\u0027s going to give a kid a nutty name like \u0027\u0027Samantha\u0027\u0027? Today\u0027s another matter, but around then, from what I hear, people weren\u0027t thinking about these stylish names.\u0026quot\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1985\u0027\u0027 , \u0027In Country\u0027, Harper\u0026amp;Row, ISBN 0060154691, pages 182, 183\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"But here\u0027s my favorite name: Samuel. It\u0027s from the Bible. If it\u0027s a girl, name it \u0027\u0027Samantha\u0027\u0027. That sounds like something in a prayer, doesn\u0027t it? I think it\u0027s a name in the Chronicles. I\u0027ve been reading the Bible every night.\u0026quot\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"She found the Book of Chronicles and scanned it. - - - There was no \u0027\u0027Samantha\u0027\u0027 in either the first or the second book of the Chronicles\", \"priority\":9}]}, \"synonyms\":{}}");

